  {
    value: "In-House & Individual Awards",
    label: "In-House & Individual Awards",
  },
  {
    value: "Legal Startups and Service Providers Awards",
    label: "Legal Startups and Service Providers Awards",
  },
  {
    value: "Intellectual Property (IP) Awards",
    label: "Intellectual Property (IP) Awards",
  },
];

const Forms = () => {
  const [firstBoxValue, setFirstBoxValue] = useState("");
    const handleFirstBoxChange = (event) => {
      setFirstBoxValue(event.target.value);
    };

  const [formData, setFormData] = useState({
    Nomination: "",
    Category: "",
    FirstName: "",
    LastName: "",
    Address: "",
    City: "",
    JobTitle: "",
    Phone: "",
    StreetAddress: "",
    codeZip: "",
    email: "",
    Organization: "",
    SubCategory:"",
  });
    const handleForm = (e) => {
      setFormData({
        ...formData,
        [e.target.name]: e.target.value,
      });
    };
  // console.log("object",formData)

  const handleSubmit = (e) => {
    e.preventDefault();

    // Create an object to hold the form data
    const data = {
      Nomination: formData.Nomination,
      Category: formData.Category,
      FirstName: formData.FirstName,
      LastName: formData.LastName,
      SubCategory:formData.SubCategory,
      Address: formData.Address,
      City: formData.City,
      JobTitle: formData.JobTitle,
      Phone: formData.Phone,
      StreetAddress: formData.StreetAddress,
      codeZip: formData.codeZip,
      email: formData.email,
      Organization: formData.Organization,
    };

    axios
      .post("https://gla-backend-new-dt4z.onrender.com/awardForm", data)
      .then((response) => {
        console.log(response.data);
      })
      .catch((error) => {
        console.error(error);
      });
  };
  return (
    <Box
      display="flex"
      justifyContent="center"
      alignItems="center"
      // Optional, adjust based on your layout requirements
    >
      {/* Place the component you want to center here */}

      <div className="col-lg-8 col-md-12">
        <h1
          style={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            backgroundColor: "#1c90c7",
            color: "white",
          }}
        >
          Award Form
        </h1>
        <form id="contactForm" onSubmit={handleSubmit}>
          <div className="row">
            <div className="col-lg-6 col-md-6">
              <div className="form-group">
                <label htmlFor="Event-For-Award-Nomination">
                  Choose Your Event For Award Nomination
                </label>
                <TextField
                  id="Event-For-Award-Nomination"
                  select
                  name="Nomination"
                  value={formData.Nomination}
                  onChange={handleForm}
                  className="col-lg-12 col-md-6"
                  label="Choose Your Event For Award Nomination"
                  // helperText="Choose Your Award Category (1st Preference)*"
                >
                  {currencies.map((option) => (
                    <MenuItem key={option.value} value={option.value}>
                      {option.label}
                    </MenuItem>
                  ))}
                </TextField>
                <div className="help-block with-errors"></div>
              </div>
            </div>
            <div className="col-lg-6 col-md-6">
              <div className="form-group">
                <label htmlFor="Category">
                  Choose Your Award Category (1st Preference)
                </label>
                <TextField
                  value={firstBoxValue}
                  onChange={handleFirstBoxChange}
                  id="Category"
                  select
                  name="Category"
                  value={formData.Category}
                  onChange={handleForm}
                  className="col-lg-12 col-md-6"
                  label="Choose Your Award Category (1st Preference)"
                  // helperText="Choose Your Award Category (1st Preference)*"
                >
                  {currencies1.map((option) => (
                    <MenuItem key={option.value} value={option.value}>
                      {option.label}
                    </MenuItem>
                  ))}
                </TextField>
                <div className="help-block with-errors"></div>
              </div>
            </div>
            <div className="col-lg-6 col-md-6">
              <div className="form-group">
                <label htmlFor="Event-For-Award-sub">
                  Choose Your Award Sub Category
                </label>
                <TextField
                  id="Event-For-Award-sub"
                  select
                  name="SubCategory"
                  value={formData.SubCategory}
                  onChange={handleForm}
                  className="col-lg-12 col-md-6"
                  label=" Choose Your Award Sub Category"
                  // helperText="Choose Your Award Category (1st Preference)*"
                >
                  {currencies2.map((option) => (
                    <MenuItem key={option.value} value={option.value}>
                      {option.label}
                    </MenuItem>
                  ))}
                </TextField>
                <div className="help-block with-errors"></div>
              </div>
            </div>
            <div className="col-lg-6 col-md-6">
              <div className="form-group">
                <label htmlFor="name1"> First Name*</label>
                <TextField
                  id="name1"
                  label="First Name"
                  value={formData.FirstName}
                  onChange={handleForm}
                  name="FirstName"
                  variant="outlined"
                  className="col-lg-12 col-md-6"
                />
                <div className="help-block with-errors"></div>
              </div>
            </div>
            <div className="col-lg-6 col-md-6">
              <div className="form-group">
                <label htmlFor="name2">Last Name</label>
                <TextField
                  id="name2"
                  label="Last Name"
                  value={formData.LastName}
                  onChange={handleForm}
                  name="LastName"
                  variant="outlined"
                  className="col-lg-12 col-md-6"
                />
                <div className="help-block with-errors"></div>
              </div>
            </div>
            <div className="col-lg-6 col-md-6">
              <div className="form-group">
                <label htmlFor="JobTitle">Job Title</label>
                <TextField
                  id="JobTitle"
                  label="Job Title"
                  value={formData.JobTitle}
                  onChange={handleForm}
                  name="JobTitle"
                  variant="outlined"
                  className="col-lg-12 col-md-6"
                />
                <div className="help-block with-errors"></div>
              </div>
            </div>
            <div className="col-lg-6 col-md-6">
              <div className="form-group">
                <label htmlFor="Organization">Organization*</label>
                <TextField
                  id="Organization"
                  label="Organization"
                  value={formData.Organization}
                  onChange={handleForm}
                  name="Organization"
                  variant="outlined"
                  className="col-lg-12 col-md-6"
                />
                <div className="help-block with-errors"></div>
              </div>
            </div>
            <div className="col-lg-6 col-md-6">
              <div className="form-group">
                <label htmlFor="email">Email*</label>
                <TextField
                  id="email"
                  name="email"
                  value={formData.email}
                  onChange={handleForm}
                  label="Email"
                  variant="outlined"
                  className="col-lg-12 col-md-6"
                />
                <div className="help-block with-errors"></div>
              </div>
            </div>

            <div className="col-lg-6 col-md-6">
              <div className="form-group">
                <label htmlFor="Address">Address</label>
                <TextField
                  id="Address"
                  name="Address"
                  label="Address"
                  value={formData.Address}
                  onChange={handleForm}
                  variant="outlined"
                  className="col-lg-12 col-md-6"
                />
                <div className="help-block with-errors"></div>
              </div>
            </div>
            <div className="col-lg-6 col-md-6">
              <div className="form-group">
                <label htmlFor="Phone">Phone*</label>
                <TextField
                  id="Phone"
                  label="Phone"
                  name="Phone"
                  value={formData.Phone}
                  onChange={handleForm}
                  variant="outlined"
                  className="col-lg-12 col-md-6"
                />
                <div className="help-block with-errors"></div>
              </div>
            </div>
            <div className="col-lg-6 col-md-6">
              <div className="form-group">
                <label htmlFor="StreetAddress">Street Address</label>
                <TextField
                  id="StreetAddress"
                  label="Street Address"
                  name="StreetAddress"
                  value={formData.StreetAddress}
                  onChange={handleForm}
                  variant="outlined"
                  className="col-lg-12 col-md-6"
                />
                <div className="help-block with-errors"></div>
              </div>
            </div>

            <div className="col-lg-6 col-md-6">
              <div className="form-group">
                <label htmlFor="City">City</label>
                <TextField
                  id="City"
                  label="City"
                  value={formData.City}
                  onChange={handleForm}
                  name="City"
                  variant="outlined"
                  className="col-lg-12 col-md-6"
                />
                <div className="help-block with-errors"></div>
              </div>
            </div>
            <div className="col-lg-6 col-md-6">
              <div className="form-group">
                <label htmlFor="codeZip">ZIP / Postal Code</label>
                <TextField
                  id="codeZip"
                  label="ZIP / Postal Code"
                  name="codeZip"
                  value={formData.codeZip}
                  onChange={handleForm}
                  variant="outlined"
                  className="col-lg-12 col-md-6"
                />
                <div className="help-block with-errors"></div>
              </div>
            </div>

            <div className="col-lg-12 col-md-12">
              <button type="submit" className="btn btn-primary">
                Register For Free
              </button>
              <div id="msgSubmit" className="h3 text-center hidden">
                {/* {this.successMessage()} */}
              </div>
              <div className="clearfix"></div>
            </div>
          </div>
        </form>
      </div>
    </Box>
  );
}

export default Forms
